source: |-
  (defv a 0)
  (defv b 0)
  (defv sum 0)
  (loop firstloop
    (setq a (+ a 3))
    (if (> a  999)
        (return-from firstloop)
    )
    (setq sum (+ sum a))
  )
  (loop secloop
    (setq b (+ b 5))
    (if (> b  999)
        (return-from secloop)
    )
    (if (= (% b 15) 0)
        (setq sum (- sum b))
    )
    (setq sum (+ sum b))
  ) 
  (print sum)
